import React from "react";
import "./style.css";

const App = () => {
	const input = document.getElementById("txt_username");
	var button = document.getElementById("add_todo");


	return (
		<div className="todo_div">
			<h1> ToDo List</h1>
			<input
				type="text"
				name="username"
				id="txt_username"
				placeholder="Enter Your Todo"
				className="txt_username"
			/>
			<br />
			<input
				type="submit"
				name="add todo"
				id="add_todo"
				value="add"
				className="button"
			/>
		</div>
	);
};

export default App;
